import { useState } from "react";
import CompletePage from "./pages/CompletePage";
import OrderPage from "./pages/OrderPage";
import SummaryPage from "./pages/SummaryPage";

function App() {
  const [step, setStep] = useState(0);
  return (
    <div style={{ padding: "4rem" }}>
      {step === 0 && <OrderPage />}
      {step === 1 && <SummaryPage />}
      {step === 2 && <CompletePage />}
    </div>
  );
}

export default App;
